export default function AddUser(){
    return (
        <>
          <TextField
            id="outlined-basic"
            label="Enter name"
            variant="outlined"
            onChange={(event) => setInputName(event.target.value)}
          />
          <TextField
            id="outlined-basic"
            label="Enter image"
            variant="outlined"
            onChange={(event) => {
              setInputAvatar(event.target.value);
            }}
          />

          <Button
            onClick={async () => {
              let userData = {
                name: inputName,
                avatar: inputAvatar,
                createdAt: Date.now()
              };
              await fetch("https://609e2b8c33eed80017957ee5.mockapi.io/users", {
                method: "POST",
                body: JSON.stringify(userData)
              });
            }}
            variant="outlined"
            color="primary"
          >
            Add User
          </Button>
        </>
      );
}
